import React from 'react';
import Tilt from 'react-parallax-tilt';
import brain from './brain.jpg'
import './Logo.css';


const Logo = () => {
    return(
        <div className='ma4 mt0'>
            <Tilt className="Tilt br2 shadow-2"  options={{ max : 15 }} style={{ height: 150, width: 250 }}>
            <div className="Tilt-inner pa3">
                 <img style={{paddingTop: '1px', width:""}} alt='logo' src={brain}/>
             </div>

            </Tilt>
         </div>
    )
}
export default Logo
